			["customText"] = "function()\n    \n    local damage = {94, 94} --Thick Hide\n    \n    --Ekowraith, Creator of Worlds legendary\n    if IsEquippedItem(137015) then\n        damage[1] = damage[1] * 0.955\n        damage[2] = damage[2] * 0.955\n    end\n    \n    --Armor stuff\n    local _, totalArmor = UnitArmor(\"player\")\n    local playerLevel = UnitLevel(\"player\")\n    local targetLevel = UnitLevel(\"target\")\n    if targetLevel == 0 then --if no target, use player level\n        targetLevel = playerLevel\n        local _, _, difficulty, _, _, _, _, mapID = GetInstanceInfo()\n        if difficulty == 24 then --fix for timewalking\n            targetLevel = aura_env.timewalking[mapID] or playerLevel\n        end\n    elseif targetLevel == -1 then -- ??? = -1\n        if UnitIsTrivial(\"target\") then --trivial old boss\n            targetLevel = playerLevel - 10\n        elseif UnitClassification(\"target\") == \"elite\" then --classified as boss\n            targetLevel = playerLevel + 3\n        else --not a boss but ??? means way higher level\n            targetLevel = playerLevel + 10\n        end\n    end\n    targetLevel = math.max(1, math.min(#aura_env.K, targetLevel)) --cap level to K values we have\n    local armorDR = 1 - totalArmor / (totalArmor + aura_env.K[targetLevel])\n    if armorDR < 0.15 then\n        aura_env.armorCap(true)\n        armorDR = 0.15\n    else\n        aura_env.armorCap(false)\n    end\n    damage[1] = damage[1] * armorDR\n    \n    --Trinkets\n    for i = 1, #aura_env.trinkets do\n        local trinketDR = aura_env.getTrinketDR(aura_env.trinkets[i].itemID, aura_env.trinkets[i].spellID, aura_env.trinkets[i].maxBonusID)\n        damage[1] = damage[1] * (1 - trinketDR)\n        damage[2] = damage[2] * (1 - trinketDR)\n    end\n    \n    --Versatiility\n    local vers = 1 - ((GetCombatRatingBonus(29) + GetVersatilityBonus(30)) / 200)\n    damage[1] = damage[1] * vers\n    damage[2] = damage[2] * vers\n    \n    --Rend and Tear\n    if select(4, GetTalentInfo(7,1,1)) then\n        local name, _, _, stacks = UnitDebuff(\"target\", GetSpellInfo(192090), nil, \"PLAYER\")\n        if name then\n            local rnt = 1 - stacks * 0.02\n            damage[1] = damage[1] * rnt\n            damage[2] = damage[2] * rnt\n        end\n    end\n    \n    --Moonfire with Scintillating Moonlight\n    if UnitDebuff(\"target\", GetSpellInfo(164812), nil, \"PLAYER\") then\n        --check artifact traits\n        local currentRank = 0\n        local loaded = IsAddOnLoaded(\"LibArtifactData-1.0\") or LoadAddOn(\"LibArtifactData-1.0\")\n        if loaded then\n            aura_env.LAD = aura_env.LAD or LibStub(\"LibArtifactData-1.0\")\n            if not aura_env.LAD:GetActiveArtifactID() then\n                aura_env.LAD:ForceUpdate()            \n            end\n            local _, traits = aura_env.LAD:GetArtifactTraits()\n            if traits then\n                for _,v in ipairs(traits) do\n                    if v.spellID == 238049 then\n                        currentRank = v.currentRank\n                        break\n                    end\n                end\n            end\n        end\n        local trait = 1 - 0.01 * currentRank\n        damage[1] = damage[1] * trait\n        damage[2] = damage[2] * trait\n    end\n    \n    local i = 1\n    while(UnitAura(\"player\", i)) do\n        \n        local spellID = select(11, UnitAura(\"player\", i))\n        \n        if spellID == 61336 then --Survival Instincts\n            \n            --check artifact traits\n            local currentRank = 0\n            local loaded = IsAddOnLoaded(\"LibArtifactData-1.0\") or LoadAddOn(\"LibArtifactData-1.0\")\n            if loaded then\n                aura_env.LAD = aura_env.LAD or LibStub(\"LibArtifactData-1.0\")\n                if not aura_env.LAD:GetActiveArtifactID() then\n                    aura_env.LAD:ForceUpdate()            \n                end\n                local _, traits = aura_env.LAD:GetArtifactTraits()\n                if traits then\n                    for _,v in ipairs(traits) do\n                        if v.spellID == 200415 then\n                            currentRank = v.currentRank\n                            break\n                        end\n                    end\n                end\n            end\n            local trait = 1 - (0.5 + 0.1 / 3 * currentRank)\n            damage[1] = damage[1] * trait\n            damage[2] = damage[2] * trait\n            \n        elseif spellID == 210320 then --Devotion Aura\n            \n            local devo = (100 + select(17, UnitAura(\"player\", i))) / 100\n            damage[1] = damage[1] * devo\n            damage[2] = damage[2] * devo\n            \n        else --simple buffs from the watchlist\n            \n            local reduce = aura_env.spells[spellID] or {0, 0}\n            damage[1] = damage[1] * (1 - reduce[1]) \n            damage[2] = damage[2] * (1 - reduce[2]) \n            \n        end\n        \n        i = i + 1\n        \n    end\n    \n    return string.format([[\n%d%%%%\n%d%%%%]],\n        100 - math.floor(damage[1]),\n        100 - math.floor(damage[2])\n    )\nend",
