			["customText"] = "function()\n    -- H2P - Simple Stat Weights\n    -- Version: 0.7a\n    -- Date: 01/12/2017\n    -- All credit goes to original authors @ HowToPriest.com, I simply created a WeakAura based off their work. Spreadsheet this was based off of can be found on HowToPriest.com's discord.\n    -- https://docs.google.com/spreadsheets/d/19sCc2wmPh02oz6ZIazGElbnRNc329_rzx0J_bi-JsXU/edit#gid=381968880\n    local _output = aura_env.output or nil;\n    return aura_env.output\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
