					["custom"] = "-- OPTIONS\n\n---- Adjust for your percentage of atonement healing:\naura_env.percAtonement = 0.6;\n\n---- Adjust for your spells contributions towards atonement:\naura_env.percPenance = 0.301263333333333; -- Penance\naura_env.percPTW = 0.191673333333333;     -- Purge the Wicked\naura_env.percPWS = 0.0938033333333333;    -- Power Word: Shield\n\n\n",
