				["custom"] = "function()\n    local normalize = function(stat, base, decimals)\n        decimals = decimals or 3;\n        local _math = (stat / base)\n        local mult = 10^(decimals or 0)\n        return math.floor(_math * mult + 0.5) / mult\n    end\n    \n    local weapon = {};\n    weapon = GetItemInfo(GetInventoryItemLink('player', 16));\n    if not weapon then do return end end;\n    \n    local race = UnitRace('player');\n    \n    aura_env.info = aura_env.info or {};\n    aura_env.info['race'] = (((race == 'Dwarf') or (race == 'Tauren')) and 1) or 0;\n    aura_env.info['intellect'] = UnitStat('player', 4);\n    aura_env.info['haste'] = GetCombatRating(CR_HASTE_SPELL);\n    aura_env.info['crit'] = GetCombatRating(CR_CRIT_SPELL);\n    aura_env.info['mastery'] = GetCombatRating(CR_MASTERY);\n    aura_env.info['versatility'] = GetCombatRating(CR_VERSATILITY_DAMAGE_TAKEN);\n    aura_env.info['leech'] = GetCombatRating(CR_LIFESTEAL);\n    aura_env.info['cloak'] = ((GetItemInfo(GetInventoryItemID('player', 15)) == 'Drape of Shame') and 1) or 0;\n    \n    aura_env.info['ilevel'] = select(4, weapon);\n    \n    local _intellect = aura_env.info['intellect'] or 0;\n    local _haste = aura_env.info['haste'] or 0;\n    local _crit = aura_env.info['crit'] or 0;\n    local _mastery = aura_env.info['mastery'] or 0;\n    local _versatility = aura_env.info['versatility'] or 0;\n    local _leech = aura_env.info['leech'] or 0;\n    local _race = aura_env.info['race'] or 0;\n    local _cloak = aura_env.info['cloak'] or 0;\n    local _ilevel = aura_env.info['ilevel'] or 0;\n    local _atonement = aura_env.percAtonement or 0.6;\n    local _penance = aura_env.percPenance or 0.301263333333333;\n    local _ptw = aura_env.percPTW or 0.191673333333333;\n    local _pws = aura_env.percPWS or 0.0938033333333333;\n    \n    if _intellect == 0 then do return end end;\n    \n    _intellect = (_intellect + 1365 + 342);\n    \n    local _multi_haste = ( 1 + ( _haste/ 375 ) / 100 );\n    local _multi_crit = ( 1 + ( _crit / 400 ) / 100 ) + 0.06;\n    local _multi_mastery = ( 1 + ( _mastery / ( 1000/3.75 ) ) / 100 ) + 0.12;\n    local _multi_versatility = ( 1 + ( _versatility / 475 ) / 100 );\n    \n    local _value_crit = (1 + ( _cloak / 10 ) + ( _race * 0.02 ) );\n    \n    _w_intellect = ( 1000 / ( (_intellect / 100 ) / 1.05) );\n    _w_crit = ( 1000 * ( _value_crit ) / 400 / ( ( ( _multi_crit - 1 ) * ( _value_crit ) + 1 ) ) );\n    _w_mastery = ( 1000 * ( 1 / ( 1000 / 3.75 ) / ( _multi_mastery ) * _atonement ) );\n    _w_versatility = ( 1000 * ( 1 / 475 / ( _multi_versatility ) ) );\n    _w_haste = ( max(_w_crit, _w_mastery, _w_versatility) * 1.1 );\n    _w_leech = ( 1000 / 300 * 0.75 );\n    \n    _disc_weights = {};\n    _disc_weights[0] = 1;\n    _disc_weights[1] = normalize(_w_haste, _w_intellect);\n    _disc_weights[2] = normalize(_w_crit, _w_intellect);\n    _disc_weights[3] = normalize(_w_mastery, _w_intellect);\n    _disc_weights[4] = normalize(_w_versatility, _w_intellect);\n    _disc_weights[5] = normalize(_w_leech, _w_intellect);\n    \n    _output = 'Discipline Stat Weights ('..(_atonement*100)..'%%):\\n\\n';\n    _output = _output..'Intellect ('..UnitStat('player', 4)..'):\\n';\n    _output = _output..'Haste ('.._haste..'):'..'\\n';\n    _output = _output..'Crit ('.._crit..'):'..'\\n';\n    _output = _output..'Mastery ('.._mastery..'):'..'\\n';\n    _output = _output..'Versatility ('.._versatility..'):'..'\\n';\n    _output = _output..'Leech ('.._leech..'):';\n    \n    aura_env.output = _output\n    \nend",
